import React from "react";
import ReactDOM from "react-dom";
import ContextAiOwl from './ContextAiOwl'
import App from "./App";
import { BrowserRouter } from 'react-router-dom';

const rootElement = document.getElementById("root");
ReactDOM.render(
  <React.StrictMode>
    <ContextAiOwl>
      <BrowserRouter>
        <App />
      </BrowserRouter>
    </ContextAiOwl>
  </React.StrictMode>,
  rootElement
);
